The one downside of healthy hair? The fact it’s so slippery and doesn’t hold texture, ever 🥹💜 these help me add that volume and texture that lasts all day god bless 

Products: @amika dry shampoo 
@redken spray wax 
@kenraprofessional spray clay

When using serums like this something people often forget is to make sure you’re not using an essence that has too many emollient ingredients that can prevent actives from penetrating/working! I like to use something like @jordansamuelskin hydrating mist before my @dieuxskin deliverance, instead of my more moisturizing essences like @kosas plump and juicy or @laneige_us cream skin! 

Products used: 

@jordansamuelskin hydrating mist (discount code: dana15)

@dieuxskin deliverance (discount code DANA10) ✨holy grail for life can’t live without✨ by far my favorite serum for sensitive skin, texture, redness, and pigmentation. I have my mom using this twice a day and the change in her skin has been INSANE. I say deliverance is like your reliable best friend, although she may not have instant dramatic effects, she is your reliable workhorse that helps your entire routine work better for you. 

@hadalabovn.official hyaluronic essence 🫶 although hyaluronic isn’t my fave humectant this essence is sooo much more than just that. It’s packed with tons of hydrating ingredients and has a juicy texture that leaves your skin super plump. A great alternative is @kosas plump and juicy or @laneige_us cream skin 

@experimentwrld super saturated (discount code: dana10) 
Super saturated revolutionized my routine and has been apart of my skincare wayyy before it was launched. I did indeed accidentally leak this product multipel times, sorry @lisagrrera 🤪 this is by far the best hydrating serum/makeup prep on the market in my opinion. It includes 30% glycerin (so superior to hyaluronic acid) as well as 3 different weights of polyglutamic acid, and other barrier supporting ingredients. This is my go to for makeup prep since it has a similar texture to some of your favorite grippy primers, due to the glycerin content. 

@jordansamuelskin I’m using the recovery cream here but usually I use the performance cream during hotter months because it’s almost a gel cream texture. 

Lastly I go in with the @bloomeffects tulip nectar which is a beautiful occlusive ointment that’s high in glycerin and leaves skin with a gorg glow. I also use this on all the spots I’m getting laser hair removal ✨

My melasma gets sooo difficult over the summer months that instead of using full coverage products I just let it shine like freckles and embrace it during the summer. This has been my go to routine for the last few months!!

Also how stunning is @thetopangahideout ?!?!

